import "./UserDatas.css";
import React, { Fragment } from "react";

const UserDatas = (props) => {
  console.log(typeof props.userdata);
  console.log(props.userdata[0]);
  console.log(Object.values(props.userdata));

  return (

    <>
      {props.userdata.map((user, index) => {
    console.log(user.address)  
        return (
          <Fragment key={index}>
            <p>{user.name}</p>
            <tr><td>{user.id}</td>
            <td>{user.name}</td>
            <td>{user.email}</td>
            <td>{user.phone}</td>
            <td>`{user.address.street},{user.address.suite},{user.address.city},{user.address.zipcode}`</td></tr>
          </Fragment>
        );
      })}
    </>
  );
};

export default UserDatas;
